We don't have a specific plan for updating Master Key Providers; instead, we plan to move the Java Encryption SDK to our new and improved way of specifying wrapping keys, [Keyrings](https://docs.aws.amazon.com/encryption-sdk/latest/developer-guide/choose-keyring.html), which do support symmetric keys.

In the meantime, your best option for local development is likely to do some sort of mocking of KMS.

I'm going to close this out, but feel free to re-open or open another issue if you have any other questions.

Thanks,
Ben

